    citations_response = None
    start_time = time.time()
    try:
        # 按行分割并处理
        lines = content_str.split('\n')
        json_load_all_st = time.time()
        for line in lines:
            line = line.strip()
            if line.startswith('data: '):
                try:
                    data = json.loads(line[6:].strip())  # 移除 'data: ' 前缀
                    response_chunks.append(data)

                    # 优化：直接提取内容，避免重复遍历
                    if "choices" in data and data["choices"]:
                        choice = data["choices"][0]
                        if "delta" in choice and "content" in choice["delta"]:
                            content = choice["delta"]["content"]
                            if content:
                                content_parts.append(content)

                    # 保存包含citations的第一个响应
                    if (citations_response is None and
                        "citations" in data and
                        data["citations"].get("total_results", 0) > 0):
                        citations_response = data

                    # 保存最后一个响应
                    final_response = data
                except json.JSONDecodeError as e:
                    print(f"JSON解析失败，跳过行: {line[:100]}... 错误: {e}")
                    continue
    except UnicodeDecodeError as e:
        print(f"响应解码失败: {e}")
        return {"error": "Response decode error"}

    parse_end = time.time()
    print(f"jsonload总耗时 {parse_end - json_load_all_st}")

    # 响应组装阶段
    assembly_start = time.time()

    # 如果我们有响应块，组合内容
    if response_chunks and final_response:
        # 优化：直接使用已收集的content_parts，避免重复遍历
        if content_parts and "choices" in final_response and final_response["choices"]:
            # 确保final_response有正确的结构
            if "message" not in final_response["choices"][0]:
                final_response["choices"][0]["message"] = {}
            final_response["choices"][0]["message"]["content"] = "".join(content_parts)

        # 如果有citations响应，使用其中的citations信息
        if citations_response and "citations" in citations_response:
            final_response["citations"] = citations_response["citations"]

        assembly_end = time.time()
        print(f"响应组装耗时: {assembly_end - assembly_start:.3f}秒")

        total_time = time.time() - start_time
        print(f"_non_stream_generate总耗时: {total_time:.3f}秒")
        print("非流式响应处理完成")
        final_response_content = final_response["choices"][0]["message"]["content"]
        return final_response_content
    # 如果没有响应，返回错误
    return {"error": "No response received"}

